import React from "react";
import styled from "styled-components";
import { useMocks } from "../context/mock-context";
const Menu = props => {
  const { menu } = useMocks();
  return (
    <MenuDesktop>
      {menu.map(item => (
        <li>{item.item}</li>
      ))}
    </MenuDesktop>
  );
};
export default Menu;

const MenuDesktop = styled.ul`
  display: flex;
`;
